#!/usr/bin/env python3

# Standard library imports
from random import randint, choice as rc

# Remote library imports
from faker import Faker

# Local imports
from app import app
from models import db, Flight

if __name__ == '__main__':
    # fake = Faker()
    with app.app_context():
        # Delete current flight data before seeding...
        Flight.query.delete()

        # Begin seeding...
        print("Starting seed...")

        flight_1 = Flight(airline="Emirates", image="data:image/jpeg;base64,")
        flight_2 = Flight(airline="American Airlines", image="data:image/jpeg;base64,")

        db.session.add_all([flight_1, flight_2])
        db.session.commit()

        print("🌱 Flights successfully seeded! 🌱")